import * as style from "../../css/light/focusedList"

export default function FocusedDeviceList(props, type) {
  const renderFocusedDeviceItem = list => {
    console.log(props.meta[list])
    return (<div>{`Label: ${props.meta[list][type]}`}</div>)}

  return props.profile['lines'].map((item, i) => (
    <div style={style.focusContentContainer}>
      <div style={{display: "flex"}}>
        <div style={{width: "29.5vw"}}>{item}
          <div style={{...style.divider, margin: "3px 0px 2px 30px", width: "26vw"}}></div>
          {renderFocusedDeviceItem(i, props.type)}
        </div>
      </div>
    </div>
  ))
}
